goog.provide("goog.debug.logRecordSerializer");goog.require("goog.debug.LogRecord");goog.require("goog.debug.Logger");goog.require("goog.json");goog.require("goog.object");goog.debug.logRecordSerializer.Param_={TIME:"t",LEVEL_NAME:"ln",LEVEL_VALUE:"lv",MSG:"m",LOGGER_NAME:"n",SEQUENCE_NUMBER:"s",EXCEPTION:"e"};goog.debug.logRecordSerializer.serialize=function(record){var param=goog.debug.logRecordSerializer.Param_;return goog.json.serialize(goog.object.create(param.TIME,record.getMillis(),param.LEVEL_NAME,record.getLevel().name,param.LEVEL_VALUE,record.getLevel().value,param.MSG,record.getMessage(),param.LOGGER_NAME,record.getLoggerName(),param.SEQUENCE_NUMBER,record.getSequenceNumber(),param.EXCEPTION,record.getException()&&record.getException().message))};goog.debug.logRecordSerializer.parse=function(s){return goog.debug.logRecordSerializer.reconstitute_(goog.json.parse(s))};goog.debug.logRecordSerializer.unsafeParse=function(s){return goog.debug.logRecordSerializer.reconstitute_(goog.json.unsafeParse(s))};goog.debug.logRecordSerializer.reconstitute_=function(o){var param=goog.debug.logRecordSerializer.Param_,level=goog.debug.logRecordSerializer.getLevel_(o[param.LEVEL_NAME],o[param.LEVEL_VALUE]),ret=new goog.debug.LogRecord(level,o[param.MSG],o[param.LOGGER_NAME],o[param.TIME],o[param.SEQUENCE_NUMBER]),exceptionMessage=o[param.EXCEPTION];if(goog.isDefAndNotNull(exceptionMessage)){ret.setException(new Error(exceptionMessage))}return ret};goog.debug.logRecordSerializer.getLevel_=function(name,value){var level=goog.debug.Logger.Level.getPredefinedLevel(name);return level&&level.value==value?level:new goog.debug.Logger.Level(name,value)};